import React from "react";
import "./page.css"
import List from "../game/race/list/list";

class PageRace extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0
        }
    }

    render() {
        return (
            <div className="page-app" style={this.style_set}>
                <List />
            </div>
        );
    }
}

export default PageRace
